import './Reviews.css';

import reviews from './revs.json'

const Reviews = () => {

  let data = reviews.data

  const reviewList = (reviews) => {
    reviews.forEach(review => {
      console.log(review.author_title)
      return (
        <div className='reviews-container'>
          <p>{review.author_title}</p>
        </div>
      )
    });
  }

  return (
    <div>
      {
      data.map((review => (
        <div>
          <p>{review}</p>
        </div>
      )))
      }
    </div>
  );
};

export default Reviews;
